import axios from 'axios';
export default {
    getProfile({commit}){
        axios.get("profile")
             .then((reponse) => {
                commit('setProfile',reponse.data)
             })
             .catch((error) => {
                commit('setError',error.response.data)
             })
    }
    







    
}
